<body>
    <div class="container">
        <div class="header">
            <div class="logo">玩机先生</div>
            <h1 class="title">简繁体字符转换器</h1>
            <div class="subtitle">简单 · 高效 · 准确 · 支持API调用</div>
        </div>
        
        <div class="main-content">
            <div class="input-section">
                <h2 class="section-title"><i class="fas fa-download"></i> 输入文本</h2>
                <textarea id="input-text" placeholder="请输入要转换的文本..."></textarea>
            </div>
            
            <div class="output-section">
                <h2 class="section-title"><i class="fas fa-upload"></i> 转换结果</h2>
                <textarea id="output-text" readonly="" placeholder="转换结果将显示在这里..."></textarea>
            </div>
        </div>
        
        <div class="controls">
            <button class="btn" id="to-traditional">
                <i class="fas fa-exchange-alt"></i> 转为繁体
            </button>
            
            <div class="swap-icon" id="swap-btn">⇄</div>
            
            <button class="btn" id="to-simplified">
                <i class="fas fa-exchange-alt"></i> 转为简体
            </button>
            
            <button class="btn btn-clear" id="clear-btn">
                <i class="fas fa-trash"></i> 清空
            </button>
            
            <div class="counter">
                字符数: <span id="char-count">0</span>
            </div>
        </div>
        
        <div class="footer">
            © 2025 玩机先生 · 简繁体转换工具 | 字符数据来自网络 | <span class="open-source-link" id="open-source-link">已开源</span>
        </div>
    </div>

    <!-- 开源信息模态窗口 -->
    <div class="modal" id="open-source-modal" style="display: flex;">
        <div class="modal-content">
            <span class="close-btn" id="close-modal">×</span>
            <h2 class="modal-title">开源信息 &amp; API文档</h2>
            <div class="modal-body">
                <p>这是一个开源的简繁体字符转换工具，基于PHP和Web技术实现。</p>
                <p>项目采用MIT许可证，允许自由使用和修改代码。</p>
                <p>字符转换数据来自网络公开资源，转换算法由玩机先生实现。</p>
                
                <h3>API调用说明</h3>
                <p>本工具支持通过URL参数直接调用转换功能：</p>
                
                <div class="api-info">
                    <p><strong>简体转繁体API：</strong></p>
                    <p class="api-url">https://tool.wanjixs.com/zf/ztftzh.php?jt=需要转换的简体文字</p>
                    
                    <p><strong>繁体转简体API：</strong></p>
                    <p class="api-url">https://tool.wanjixs.com/zf/ztftzh.php?ft=需要轉換的繁體文字</p>
                    
                    <p><strong>响应格式：</strong> 纯文本响应</p>
                    <p><strong>示例：</strong></p>
                    <p class="api-url">https://tool.wanjixs.com/zf/ztftzh.php?jt=你好世界</p>
                    <p>将直接返回"你好世界"的繁体版本"你好世界"</p>
                </div>
                
                <p>欢迎贡献代码和提出改进建议！</p>
            </div>
            <div class="modal-footer">
                <button class="download-btn" id="download-source">
                    <i class="fas fa-download"></i> 下载源码
                </button>
                <a href="#" class="github-btn">
                    <i class="fab fa-github"></i> GitHub仓库
                </a>
            </div>
        </div>
    </div>

