        // 创建反向映射（简体到繁体）
        const reverseCharMap = {};
        for (const [traditional, simplified] of Object.entries(charMap)) {
            reverseCharMap[simplified] = traditional;
        }

        // 获取DOM元素
        const inputText = document.getElementById('input-text');
        const outputText = document.getElementById('output-text');
        const toTraditionalBtn = document.getElementById('to-traditional');
        const toSimplifiedBtn = document.getElementById('to-simplified');
        const clearBtn = document.getElementById('clear-btn');
        const swapBtn = document.getElementById('swap-btn');
        const charCount = document.getElementById('char-count');
        const openSourceLink = document.getElementById('open-source-link');
        const openSourceModal = document.getElementById('open-source-modal');
        const closeModal = document.getElementById('close-modal');
        const downloadSource = document.getElementById('download-source');

        // 转换为繁体
        function convertToTraditional(text) {
            return text.split('').map(char => reverseCharMap[char] || char).join('');
        }

        // 转换为简体
        function convertToSimplified(text) {
            return text.split('').map(char => charMap[char] || char).join('');
        }

        // 更新字符计数
        function updateCharCount() {
            charCount.textContent = inputText.value.length;
        }

        // 事件监听器
        inputText.addEventListener('input', updateCharCount);

        toTraditionalBtn.addEventListener('click', () => {
            outputText.value = convertToTraditional(inputText.value);
        });

        toSimplifiedBtn.addEventListener('click', () => {
            outputText.value = convertToSimplified(inputText.value);
        });

        clearBtn.addEventListener('click', () => {
            inputText.value = '';
            outputText.value = '';
            updateCharCount();
        });

        swapBtn.addEventListener('click', () => {
            const temp = inputText.value;
            inputText.value = outputText.value;
            outputText.value = temp;
            updateCharCount();
        });

        // 开源信息模态窗口
        openSourceLink.addEventListener('click', () => {
            openSourceModal.style.display = 'flex';
        });

        closeModal.addEventListener('click', () => {
            openSourceModal.style.display = 'none';
        });

        // 点击模态窗口外部关闭
        window.addEventListener('click', (event) => {
            if (event.target === openSourceModal) {
                openSourceModal.style.display = 'none';
            }
        });

        // 下载源码功能
        downloadSource.addEventListener('click', () => {
            // 创建一个Blob对象
            const blob = new Blob([document.documentElement.outerHTML], { type: 'text/html' });
            
            // 创建一个下载链接
            const downloadLink = document.createElement('a');
            downloadLink.href = URL.createObjectURL(blob);
            downloadLink.download = '简繁体转换工具-玩机先生.php';
            
            // 模拟点击下载
            document.body.appendChild(downloadLink);
            downloadLink.click();
            document.body.removeChild(downloadLink);
            
            // 显示下载成功消息
            alert('源码下载成功！文件名为: 简繁体转换工具-玩机先生.php');
        });

        // 初始化字符计数
        updateCharCount();
